INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('1 <= n <= 100', 'A single line containing a positive integer, n.', 'Print Weird if the number is weird; otherwise, print Not Weird.', 'Java Flow Control2', 'Given an integer, n, perform the following conditional actions: If n is odd, print Weird If n is even and in the inclusive range of 2 to 5, print Not Weird If n is even and in the inclusive range of 6 to 20, print Weird If n is even and greater than 20, print Not Weird Complete the stub code provided in your editor to print whether or not n is weird.', 'import java.io.*;
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('-', 'There are three lines of input: The first line contains an integer. The second line contains a double. The third line contains a String.', 'On the first line, print String:On the second line, print Double: On the third line, print Int:', 'Java I/O', 'In this challenge, you must read an integer, a double, and a String from stdin, then print the values according to the instructions in the Output Format section below. To make the problem a little easier, a portion of the code is provided for you in the editor.', 'import java.util.Scanner;
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('2 <= N <= 20', 'A single integer, N.', 'Print 10 lines of output; each line i (where 1 <= i <= 10) contains the result of N x i in the form:  N x i = result.', 'Java Loops', 'Given an integer, N, print its first 10 multiples. Each multiple N x i (where 1 <= i <= 10) should be printed on a new line in the form: N x i = result.', 'import java.io.*;
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('-', 'The first line contains a string A. The second line contains another string B. The strings are comprised of only lowercase English letters.', 'first line, sum the lengths of A and B.  second line, write Yes if A is lexicographically greater than B otherwise print No instead.  third line, capitalize the first letter in both A and B and print them on a single line, separated by a space.', 'Java Strings', 'The elements of a String are called characters. The number of characters in a String is called the length, and it can be retrieved with the String.length() method. Given two strings of lowercase English letters, A and B, perform the following operations: 1- Sum the lengths of A and B. 2- Determine if A is lexicographically larger than B (i.e.: does B come before A in the dictionary?). 3- Capitalize the first letter in A and B and print them on a single line, separated by a space.', 'import java.io.*;
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('1 <= |s| <= 1000 where s consist of only English alphabetic chars  ', 'The first line contains a string denoting s.  The second line contains an integer denoting k.', 'Return the respective lexicographically smallest and largest substrings as a single newline-separated string.', 'Java Strings', 'Lexicographical Order, also known as alphabetic or dictionary order, orders characters as follows:   For example, ball < cat, dog < dorm, Happy < happy, Zoo < ball. A substring of a string is a contiguous block of characters in the string. For example, the substrings of abc are a, b, c, ab, bc, and abc. Given a string, s, and an integer, k, complete the function so that it finds the lexicographically smallest and largest substrings of length k.', 'import java.util.Scanner;
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('Each sentence consists of at most 10ˆ4 English alphabetic letters and whitespaces where 1 <= n <= 100', 'The first line contains an integer, n, denoting the number of sentences.  Each of the n subsequent lines contains a single sentence consisting of English alphabetic letters and whitespace characters.', 'Stub code in the editor prints the sentence modified by the replaceAll line to stdout. The modified string must be a modified version of the initial sentence where all repeat occurrences of each word are removed.', 'Java Regex', 'In this challenge, we use regular expressions (RegEx) to remove instances of words that are repeated more than once, but retain the first occurrence of any case-insensitive repeated word. For example, the words love and to are repeated in the sentence I love Love to To tO code. Can you complete the code in the editor so it will turn I love Love to To tO code into I love to code? To solve this challenge, complete the following three lines: 1- Write a RegEx that will match any repeated word. 2- Complete the second compile argument so that the compiled RegEx is case-insensitive. 3- Write the two necessary arguments for replaceAll such that each repeated word is replaced with the very first instance the word found in the sentence. It must be the exact first occurrence of the word, as the expected output is case-sensitive.', 'import java.util.Scanner;
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('-', 'The first line contains a single integer, n, denoting the size of the array.  Each line i of the n subsequent lines contains a single integer denoting the value of element ai.', 'You are not responsible for printing any output to stdout. Locked code in the editor loops through array a and prints each sequential element on a new line. Sample', 'Java Arrays', 'The code in your editor does the following: 1- Reads an integer from stdin and saves it to a variable, n, denoting some number of integers. 2- Reads n integers corresponding to a0, a1, ..., a(n-1) from stdin and saves each integer a(i) to a variable, val. 3- Attempts to print each element of an array of integers named a. Write the following code in the unlocked portion of your editor: 1- Create an array, a, capable of holding n integers. 2- Modify the code in the loop so that it saves each sequential value to its corresponding location in the array. For example, the first value must be stored in a0, the second value must be stored in a1, and so on. Good luck!', 'import java.util.Scanner;
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('1 <= integer variables, float variables <= 10ˆ4', 'The first line contains two integers.  The second line contains two floating point numbers.', 'Print the sum and difference of both integers separated by a space on the first line, and the sum and difference of both float (scaled to 1 decimal place) separated by a space on the second line.', 'C Operators', 'Your task is to take two numbers of int data type, two numbers of float data type as input and output their sum: 1- Declare 4 variables: two of type int and two of type float. 2- Read 2 lines of input from stdin (according to the sequence given in the ''Input Format'' section below) and initialize your 4 variables. 3- Use the + and - operator to perform the following operations: *Print the sum and difference of two int variable on a new line. *Print the sum and difference of two float variable rounded to one decimal place on a new line.', '#include <stdio.h>
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('-', 'The input will contain two integers, a and b, separated by a newline.', 'You have to print the updated value of a and b, on two different lines. Note: Input/ouput will be automatically handled. You only have to complete the function described in the ''task'' section.', 'C Pointers', 'You have to complete the function void update(int *a,int *b), which reads two integers as argument, and sets a with the sum of them, and b with the absolute difference of them.', '#include <stdio.h>
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('-', 'nput will contain four integers - a, b, c, d , one in each line.', 'Print the greatest of the four integers.  Note: I/O will be automatically handled.', 'C Pointers', 'You have to write a function int max_of_four(int a, int b, int c, int d) which reads four arguments and returns the greatest of them.', '#include <stdio.h>
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('1 <= a <= b <= 10ˆ6', 'The first line contains an integer, a.  The seond line contains an integer, b.', 'Print the appropriate english representation,even, or odd, based on the conditions described in the ''task'' section.', 'C Loops', 'For each integer n in the interval [a, b] (given as input) : *If 1 <= n <= 9, then print the English representation of it in lowercase. That is "one" for 1, "two" for 2, and so on. *Else if n > 9 and it is an even number, then print "even". *Else if n > 9 and it is an odd number, then print "odd".', '#include <stdio.h>
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('1 <= n, a(i) <= 1000', 'The first line contains an integer, n.  The next line contains n space-separated integers.', 'Print in a single line the sum of the integers in the array.', 'C Arrays', 'In this challenge, you have to create an array of size n dynamically, input the elements of the array, sum them and print the sum of the elements in a new line.', '#include <stdio.h>
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('1 <= len(num) <= 1000', 'The first line contains a string, num which is the given number.', 'Print ten space-separated integers in a single line denoting the frequency of each digit from 0 to 9.', 'C Loops', 'Given a string, , consisting of alphabets and digits, find the frequency of each digit in the given string.', '#include <stdio.h>
INSERT INTO cvvalidator.code_question (constraints, input_format, output_format, question_title, task, template_code, id) VALUES ('2 <= n <= 9                       1 <= |s[i]| <= 10 where s[i] contains only English letters.', 'The first line of each test file contains a single integer n, the length of the string array s. Each of the next n lines contains a string s[i].', 'Print each permutation as a list of space-separated strings on a single line.', 'C Strings', 'Strings are usually ordered in lexicographical order. That means they are ordered by comparing their leftmost different characters. For example, abc < abd because c < d. Also z > yyy because z > y. If one string is an exact prefix of the other it is lexicographically smaller, e.g., gh < ghij. Given an array of strings sorted in lexicographical order, print all of its permutations in strict lexicographical order. If two permutations look the same, only print one of them. See the ''note'' below for an example. Complete the function next_permutation which generates the permutations in the described order.', '#include <stdio.h>
